import React, { Component } from "react";

class SelectButton extends Component {
	state = {};
	constructor(props) {
		super(props);

		this.state = {
			filling: "none",
			beans: "none",
			options: "none",
			rice: "none",
			beans: "none"
		};
	}

	updateOrder(order) {
		this.state.setState(order);
	}

	render() {
		return (
			<React.Fragment>
				<li>
					<div className="collapsible-header">Order</div>
					<div className="collapsible-body">
						<div className="col s12 m6">
							<div className="card white darken-4 ">
								<div className="card-content black-text">
									<p>
										{"Filling: " + this.state.order.filling}
									</p>
									<p>
										{"Beans:   " + this.state.order.beans}
									</p>
									<p>
										{"Options: " + this.state.order.options}
									</p>
									<p>{"Rice:    " + this.state.order.rice}</p>
									<p>
										{"Side:    " + this.state.order.filling}
									</p>
								</div>
							</div>
						</div>
						<div className="col s12 m6">
							<div className="card waves-effect white darken-4 ">
								<div className="card-content black-text">
									<p>Order</p>
								</div>
							</div>
						</div>
					</div>
				</li>
			</React.Fragment>
		);
	}
}

export default SelectButton;
